CREATE TABLE task_embeddings (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  chunk_content TEXT NOT NULL,
  task_id INTEGER NOT NULL REFERENCES tasks (id) ON DELETE CASCADE,
  embedding F32_BLOB (3072) NOT NULL
