    "Os gráficos e tabelas devem ser interativos e responsivos.",
    "Os usuários devem conseguir filtrar e ajustar os dados mostrados no painel.",
    "Somente usuários autenticados devem ter acesso ao painel de análise."
  ],
  "suggested_tests": [
    "it(''deve renderizar o painel com todos os componentes principais visíveis'')",
    "it(''deve exibir dados corretos e atualizados nos gráficos e tabelas'')",
    "it(''deve permitir que o usuário aplique filtros e atualize visualizações'')",
    "it(''deve permitir apenas o acesso de usuários autenticados ao painel'')"
