  "estimated_time": "5 dias",
  "implementation_suggestion": "Utilize a biblioteca Recharts para gráficos e Prisma ORM para gerenciar a conexão com o SQLite. Configure as rotas utilizando o React Router 7 e garanta responsividade com Tailwind CSS."
