**Descrição:**  
Criar Sistema de Upload com Compressão de Imagens. Essa tarefa envolve a implementação de uma funcionalidade importante para aumentar a segurança, performance, ou usabilidade do sistema. Certifique-se de validar entradas, documentar as decisões técnicas e garantir uma experiência fluida. Utilize ferramentas modernas e mantenha atenção à escalabilidade e manutenção futura.

**Tempo Estimado:**  
1 dia

## Passos

1. ["Documente no README e Wiki interna.", "Realize testes manuais e valide com usuários.", "Implemente o deploy em ambiente de staging.", "Analise os requisitos e documente os objetivos.", "Implemente a funcionalidade com testes automatizados."]

## Testes Sugeridos

- ["it(''deve atualizar dados corretamente após ação'')", "it(''deve lidar com erros de forma adequada'')", "it(''deve realizar a ação principal com sucesso'')"]

## Critérios de Aceitação

