('195', '# Criar Painel de Estatísticas com Drill-Down

**Descrição:**  
Criar Painel de Estatísticas com Drill-Down. Essa tarefa envolve a implementação de uma funcionalidade importante para aumentar a segurança, performance, ou usabilidade do sistema. Certifique-se de validar entradas, documentar as decisões técnicas e garantir uma experiência fluida. Utilize ferramentas modernas e mantenha atenção à escalabilidade e manutenção futura.

**Tempo Estimado:**  
1 dia

## Passos

1. ["Implemente o deploy em ambiente de staging.", "Realize testes manuais e valide com usuários.", "Documente no README e Wiki interna.", "Analise os requisitos e documente os objetivos.", "Implemente a funcionalidade com testes automatizados."]

## Testes Sugeridos

- ["it(''deve lidar com erros de forma adequada'')", "it(''deve bloquear acessos não autorizados'')", "it(''deve atualizar dados corretamente após ação'')"]

## Critérios de Aceitação

