**Descrição:**  
Criar Dashboard de Métricas com Chart.js. Essa tarefa envolve a implementação de uma funcionalidade importante para aumentar a segurança, performance, ou usabilidade do sistema. Certifique-se de validar entradas, documentar as decisões técnicas e garantir uma experiência fluida. Utilize ferramentas modernas e mantenha atenção à escalabilidade e manutenção futura.

